import { reqGetSearchInfo } from "@/api"
const state = {

}
const mutations = {}
const actions = {
    async getSearchList({ commit }, params = {}) {
        let result = await reqGetSearchInfo(params)
        if (result === 200) {
            commit("INFO", result.data)
        }
    }
}
const getters = {}
export default {
    state,
    mutations,
    actions,
    getters
}
